# 暴力解法
class Solution1:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        
        O(n^2) 复杂度
        """
        maxstr, tmpstr = [], []
        for j in range(len(s)):
            for i in s[j:]:
                if i not in tmpstr:
                    tmpstr.append(i)
                elif i in tmpstr:
                    maxstr = maxstr if len(maxstr) >= len(tmpstr) else tmpstr
                    tmpstr = [i]
            maxstr = maxstr if len(maxstr) > len(tmpstr) else tmpstr
            tmpstr = []
        print(maxstr)
        return len(maxstr)


# 快慢指针
class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int

        O(n) 复杂度
        """
        p1, p2 = 0, 0
        maxlen = 0
        sk = set()
        while p2 < len(s):
            if s[p2] not in sk:
                sk.add(s[p2])
                p2 += 1
                maxlen = max(maxlen, len(sk))
            else:
                start = s.index(s[p2], p1) + 1
                for i in s[p1:start]:
                    sk.remove(i)
                p1 = start
                sk.add(s[p2])
                p2 += 1
        return maxlen


